//linear probing -> index 1씩 증가
#include <iostream>
#define MAX 353333
using namespace std;

class item {
public:
	int key, value;

	item() {
		key = -1;
		value = -1;
	}
};

class arr {
public:
	item* data;
	bool flag;
	
	arr() {
		data = new item;
		flag = false;
	}	
};

arr HashArr[MAX];
int sz = 0;

int hashfunc(int idx) {
	return idx % MAX;
}

void tableInsert(int value) {
	/*
	0xC0000005: 0x000EE394 위치를 읽는 동안 액세스 위반이 발생했습니다.
	메모리 할당이 되지 않은 포인터에 값을 넣거나 할당치를 초과하여 데이터가
	입력 되었을 경우.
	*/
	int hx = hashfunc(value);
	if (HashArr[hx].flag == false) {

		/*
		cout << "before [" << value << "]insertion;flag = " << HashArr[hx].flag
			<< ", hx = " << hx
			<< ", key= " << HashArr[hx].data->value << '\n';
		*/
		HashArr[hx].flag = true;
		HashArr[hx].data->key = hx;
		HashArr[hx].data->value = value;
		sz += 1;
		/*
		cout << "after [" << value << "]insertion;flag = "<<HashArr[hx].flag
			<<", hx = " << hx
			<< ", key= " << HashArr[hx].data->value << '\n';
		*/
	}
	else if (HashArr[hx].flag == true) {
		/*
		cout << "before [" << value << "]insertion;flag = " << HashArr[hx].flag
			<< ", hx = " << hx
			<< ", key= " << HashArr[hx].data->value << '\n';
		*/
		int tmp = hx;
		int prob = 1;
		while (1) {
			if (HashArr[tmp].flag == false)
				break;
			tmp = (tmp + 1) % MAX;
			prob += 1;
		}
		HashArr[tmp].flag = true;
		HashArr[tmp].data->key = tmp; //인덱스 값 저장
		HashArr[tmp].data->value = value;
		sz += 1;
		/*
		cout << "after [" << value << "]insertion;flag = " << HashArr[hx].flag
			<< ", hx = " << hx
			<< ", key= " << HashArr[hx].data->value << '\n';
		*/
	}
}

void tableSearch(int value) {
	int hx = hashfunc(value);
	int prob = 1;
	/*
	cout << "hx = "<<hx<<" key= " << HashArr[hx].data->value
		<< " == " << value << endl;
	*/
	if (HashArr[hx].flag == false) { //존재 x
		cout << "0 1" << '\n';
	}
	else if (HashArr[hx].flag == true) {
		if (HashArr[hx].data->value == value) { //인덱스와 값이 같을 경우
			/*
			cout << "hx key = " << HashArr[hx].data->value
				<< " == " << value << endl;
			*/
			cout << "1" << ' ' << prob << '\n'; //prob==1
		}
		else {
			int tmp = hx;
			
			/*
			cout << "hx key = " << HashArr[hx].data->value
				<< " != " << value << endl;
			*/
			while (1) { //인덱스와 값은 달라도 저장되어있는 값이 같을 경우
				if (HashArr[tmp].data->value == value)
					break;
				tmp = (tmp + 1) % MAX;
				prob += 1;
			}
			cout << "1" << ' ' << prob << '\n';
		}
	}
}

int main() {
	int t;
	cin >> t;
	for (int i = 0;i < t;i++) {
		int n, m, x;
		cin >> n;
		for (int j = 0;j < n;j++) {
			cin >> x;
			//cout << "**" << j << "번째**";
			/* 
			테스트 케이스 복붙할때 500개 넘으면 입력이 막힘 원인 모르겠음
			엔터 입력하면 잘 작동됨
			*/
			tableInsert(x);
		}
		
		cin >> m;
		for (int k = 0;k < m;k++) {
			cin >> x;
			tableSearch(x);
			
		}
		
		for (int l = 0;l < MAX;l++) {
			HashArr[l].flag = false;
			HashArr[l].data->key = -1;
			HashArr[l].data->value = -1;
			/*
			delete HashArr[j].data 하면 RtlValidateHeap 에러 뜸
			*/
		}
	}
	return 0;
}

